import React from 'react';
import './Events.css';
import ImageSlideIn from '../ImageSlideIn/ImageSlideIn';

function Events() {
  const events = [
    { id: 1, src: '/img/background.jpg', alt: 'Event 1', description: 'Event 1 Description' },
    { id: 2, src: '/img/event2.jpg', alt: 'Event 2', description: 'Event 2 Description' },
    { id: 3, src: '/img/event3.jpg', alt: 'Event 3', description: 'Event 3 Description' }
  ];

  return (
    <div id="events" className="tabcontent">
      <div className="events-gallery">
        {events.map(event => (
          <div key={event.id} className="event">
            <ImageSlideIn src={event.src} alt={event.alt} />
            <p className="event-description">{event.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Events;
